for player in players:
    URL = "https://www.mockdraftable.com/player/" + player + ""
    page = requests.get(URL)
    soup = BeautifulSoup(page.content, "html.parser")
    table = soup.find('table')
    table_body = table.find('tbody')

    rows = table_body.find_all('tr')
    playerName = soup.find('div', attrs={'class':'playerbar-name'})
    playerPos = soup.find('div', attrs={'class':'playerbar'}).find("button", recursive=True)
    playerYear = soup.find('a', href=lambda x: x and '/search?beginYear=' in x)

    playerData = [playerName.text.replace(',', ''), playerPos.text, '', '', '', '', '', '', playerYear.text, '', '']
    for row in rows:
        cols = row.find_all(['td', 'th'])
        cols = [ele.text.strip() for ele in cols]

        if (cols[0] == '40 Yard Dash'):
            dashVal = cols[1]
            if ('*' not in dashVal):
                playerData[2] = dashVal.replace('s', '')

        if (cols[0] == 'Vertical Jump'):
            vertValue = cols[1]
            if ('*' not in vertValue):
                playerData[3] = vertValue.replace('\"', '').replace('', '.5')

        if (cols[0] == 'Broad Jump'):
            broadValue = cols[1]
            if ('*' not in broadValue):
                playerData[4] = broadValue.replace('\"', '')

        if (cols[0] == '3-Cone Drill'):
            coneValue = cols[1]
            if ('*' not in coneValue):
                playerData[5] = coneValue.replace('s', '')

        if (cols[0] == '20 Yard Shuttle'):
            shutValue = cols[1]
            if ('*' not in shutValue):
                playerData[6] = shutValue.replace('s', '')

        if (cols[0] == 'Bench Press'):
            benchVal = cols[1]
            if ('*' not in benchVal):
                playerData[7] = benchVal.replace(' reps', '')

        if (cols[0] == 'Height'):
            heighVal = cols[1]
            if ('*' not in heighVal):
                playerData[9] = heighVal.replace('\'', ' feet').replace('\"', ' inches')

        if (cols[0] == 'Weight'):
            weightVal = cols[1]
            if ('*' not in weightVal):
                playerData[10] = weightVal.replace(' lbs', '')

    print(*playerData, sep=',')
